import { Col, Container, Row } from "react-bootstrap"

import OneOfFour from './TeamImages/1of4.png';
import TwoOfFour from './TeamImages/2of4.png';
import ThreeOfFour from './TeamImages/3of4.png';
import FourOfFour from './TeamImages/4of4.png';

function Team(){

    const ArraysOfTeam = [{
        id: 1,
        image: OneOfFour,
        title: 'Guy Hawkins',
        text: 'CEO'
    },
    {
        id: 2,
        image: TwoOfFour,
        title: 'Jane Cooper',
        text: 'COO'
    },
    {
        id: 3,
        image: ThreeOfFour,
        title: 'Darrell Steward',
        text: 'CTO'
    },
    {
        id: 4,
        image: FourOfFour,
        title: 'Dianne Russell',
        text: 'CDO'
    }
]
    const ArraysOfTeamOnMap = ArraysOfTeam.map((ArrayOfTeam) =>
    
    <Col key = {ArrayOfTeam.id} lg = "3" md = "6" sm = "6">
        <div className="block">
            <img src = {ArrayOfTeam.image} className="w-100 rounded-circle" />
        </div>

        <div className="text-center">
            <h5>{ArrayOfTeam.title}</h5>
            <p>{ArrayOfTeam.text}</p>
        </div>
    </Col>
    )

    return(
        <Container class = "team">
            <div class = "text-center">
                <h1>Our Team</h1>
                <p>Risus commodo id odio turpis pharetra elementum. Pulvinar porta porta feugiat scelerisque in elit. Morbi rhoncus, tellus, eros consequat magna semper orci a tincidunt. </p>
            </div>

            <Row>
                {ArraysOfTeamOnMap}
            </Row>
        </Container>
    )
}

export default Team
